def longestCommonPrefix(strs):
		if len(strs) == 0:
			return ""
		i = 0
		pre = ""
		while i <= min(list(len(l) for l in strs)):
			try:
				pre += strs[0][i]
				for s in strs:
					if pre == s[:i+1]:
						pass
					else:
						return strs[0][:i]
						break
				i += 1
			except IndexError:
				break
		return strs[0][:i]
